import React from "react";
import { SubContainerStyle } from "../../styles/new_style/SubContainer.style";
import MainTitle from "./MainTitle";

function SubContainer({ title }: { title: string }) {
  return (
    <SubContainerStyle>
      <MainTitle />
      <p>
        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec in velit
        porta, sollicitudin tortor id, tincidunt nulla. Etiam in ex eget lectus
        sollicitudin varius. Integer consectetur justo a nunc ultricies.
      </p>
    </SubContainerStyle>
  );
}

export default SubContainer;
